import React from "react";
import { NavLink } from "react-router-dom";
function ShowData(props) {
  function firstName(emailId){
    let regx=/\w+[\.]?\w+/gi;
    let name=emailId.match(regx)[0]
    return name;
  }
  return (
    <>
      {props.data.map((value,index) => (
        <div className="card" key={index}>
          <div className="card-body">
            {props.type==="employee"?
            <NavLink to={`/${props.type}/${firstName(value.pField2)}`}>{value.pField1}</NavLink>:
              <table>
                <tr>
                  <th>conferenceId</th>
                  <th>date</th>
                </tr>
                <tr>
               <NavLink to={`/${props.type}/${value.pField1}`} className="link-conference"><td>{value.pField1}</td> </NavLink>
                  <td>{value.pField2}</td>
                </tr>
              </table>

            }
          </div>
        </div>
      ))}
    </>
  );
}
export default ShowData;
